<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>requirejs-min-resolver.min.html</title>
</head>
<body>

<script>
(function(){var ctx=require.s.contexts._,origNameToUrl=ctx.nameToUrl,baseUrl=ctx.config.baseUrl;ctx.nameToUrl=function(){var url=origNameToUrl.apply(ctx,arguments);if(url.indexOf(baseUrl)===0&&!url.match(/\/tiny_mce\//)&&!url.match(/\/v1\/songbird/)&&!url.match(/\.authorize\.net\/v1\/Accept/)&&!url.match(/\/pay.google.com\//)&&!url.match(/https:\/\/www.gstatic.com\/charts\/loader.js/)){url=url.replace(/(\.min)?\.js$/,'.min.js');}
return url;};})();
</script>

</body>
</html>
